import React, { useState, useEffect } from 'react';
import "./App.css";
import "./Members.js";
import { fetchMembers } from "./httpRequests";

function App() {
  const [favorites, setFavorites] = useState([]);
  const [members, setMembers] = useState([]);

  useEffect(() => {
    fetchMembers((data) => {
      return Promise.all([data]);
    }).then((memberset) => {
      setMembers(memberset);
    })
  }, []);

  console.log(members);

  return (
  <>
    {members && members.map((member) => {
        return( 
        <div key={member.id}>

            <a href="">
              <p>{member.login}</p>
              <img src={member.avatar_url} />
            </a>
        </div>);
    })}
  </>);
}

export default App;
